// --- Helpers to use the stored ADP with your DraftTab ---
const norm = (s) =>
  String(s || "")
    .toLowerCase()
    .replace(/\./g, "")
    .replace(/'/g, "")
    .replace(/\b(jr|sr|ii|iii|iv|v|vi)\b/g, "")
    .replace(/\s+/g, " ")
    .trim();

const kExact = (name, pos, team) =>
  `${norm(name)}|${String(pos || "").toUpperCase()}|${String(
    team || ""
  ).toUpperCase()}`;

// 2) Build fast lookup maps per year
export function buildFPAdpIndex() {
  const idx = {}; // { [year]: { exact: Map, byName: Map, byNamePos: Map } }
  for (const [yrStr, rows] of Object.entries(FP_ADP_BY_YEAR)) {
    const yr = Number(yrStr);
    const exact = new Map();
    const byName = new Map();
    const byNamePos = new Map();

    (rows || []).forEach((r) => {
      // support either array rows or object rows
      const [nameA, posA, teamA, adpA] = Array.isArray(r)
        ? r
        : [
            r.name ?? r.player,
            r.pos ?? r.position,
            r.team ?? r.nfl ?? r.proTeam,
            r.adp ?? r.ADP,
          ];

      const name = nameA || "";
      const pos = (posA || "").toUpperCase();
      const team = (teamA || "").toUpperCase();
      const adp = Number(adpA);

      if (!name || Number.isNaN(adp)) return;

      exact.set(kExact(name, pos, team), adp);
      if (!byName.has(norm(name))) byName.set(norm(name), adp);
      const np = `${norm(name)}|${pos}`;
      if (!byNamePos.has(np)) byNamePos.set(np, adp);
    });

    idx[yr] = { exact, byName, byNamePos };
  }
  return idx;
}

// 3) Merge stored FP ADP into your draft rows
export function attachStoredFPADP(draftByYear, fpIdx) {
  const out = {};
  for (const [yrStr, rows] of Object.entries(draftByYear || {})) {
    const yr = Number(yrStr);
    const fp = fpIdx?.[yr];

    out[yr] = (rows || []).map((r) => {
      if (!fp)
        return { ...r, adp: r.adp ?? null, adpSource: r.adp ? "ESPN" : null };

      const name = r.player || "";
      const pos = r.pos || "";
      const team = r.nfl || "";

      let adp = null;
      const ex = kExact(name, pos, team);
      if (fp.exact.has(ex)) adp = fp.exact.get(ex);
      if (adp == null && fp.byName.has(norm(name)))
        adp = fp.byName.get(norm(name));
      if (adp == null) {
        const np = `${norm(name)}|${String(pos || "").toUpperCase()}`;
        if (fp.byNamePos.has(np)) adp = fp.byNamePos.get(np);
      }

      if (adp != null) return { ...r, adp, adpSource: "FP(stored)" };
      if (r.adp != null) return { ...r, adpSource: "ESPN" };
      return { ...r, adp: null, adpSource: null };
    });
  }
  return out;
}
